package mq

import "encoding/hex"

import "log"

func handleInitialData(msg, tshType []byte) (response []byte) {
	log.Printf("[INFO] received INITIAL_DATA message with header type %s\n", tshType)

	switch string(tshType) {
	case "TSH ":
		response, _ = hex.DecodeString("")
	case "TSHM":
		response, _ = hex.DecodeString("")
	}

	return response
}
